column8:
★ナイキの保冷専用ボトル！<br>
<br>
●ワンタッチオープンなので飲みたいときにすぐに飲めて便利！<br>
●シンプルな構造のキャップユニットは丸洗いができていつでも衛生的！<br>
●本体には耐衝撃性に優れたラバーグリップで滑らず持ちやすい！<br>
●大きな氷も入れやすいワイド口径！<br>
●ファスナーで開閉し、ベルクロで固定するハンディポーチ付き！持ち運びに便利なストラップ付き！<br>
●ポーチ内の縁はグリップつきでボトルが抜け落ちにくい！<br>
●スポーツシーンやレジャー、アウトドアに重宝するアイテムです！<br>
<br>
■素材<br>
本体：ステンレス鋼(アクリル樹脂塗装)<br>
フタ・キャップ本体：ポリプロピレン<br>
フタパッキン、シールパッキン、ボディリング・ソコカバー：シリコン<br>
■企画製造販売元 サーモス株式会社<br>
<br>
※画像のカラーは、撮影時の照明等の具合により実物と異なる可能性がございます。<br>
なお、商品の色の見え方と実物の色は、お客様のご使用されているパソコン・モニターの環境等により多少異なる場合がございますのでご了承ください。<br>
<BR>
<BR>
■実用量：1.5L<br>
■保冷効力：9度以下(6時間) 
